                from (Select t.Team_Name, CONCAT(p.Part_FName,' ',p.Part_MName,' ',p.Part_LName)fullname
                 from participants p
                inner join teams t on p.Team_ID=t.Team_ID
                inner join attended_culturalevents ac on p.Part_ID = ac.Part_ID
                inner join criteria_score cr on ac.ACE_ID = cr.ACE_ID
                inner join cultural_overall_score co on ac.ACE_ID = co.ACE_ID
                inner join cultural_events ce on ac.Cul_ID = ce.Cul_ID where ce.Cul_ID = getCul_ID
                group by fullname
                order by COS_TotalScore desc) X);




      while  sumdata>=0 DO



      set get_COS_ID = (SELECT X.COS_ID
                from (Select co.COS_ID,t.Team_Name, CONCAT(p.Part_FName,' ',p.Part_MName,' ',p.Part_LName)fullname
                 from participants p
                inner join teams t on p.Team_ID=t.Team_ID
                inner join attended_culturalevents ac on p.Part_ID = ac.Part_ID
                inner join criteria_score cr on ac.ACE_ID = cr.ACE_ID
                inner join cultural_overall_score co on ac.ACE_ID = co.ACE_ID
                inner join cultural_events ce on ac.Cul_ID = ce.Cul_ID where ce.Cul_ID = getCul_ID
                group by fullname
                order by COS_TotalScore desc LIMIT sumdata,1) X);

      set last_Cultural_ranking = (Select RP_ID from Cultural_Ranking_Points LIMIT sumdata,1);

     INSERt into Cultural_Generated_Ranking_Points(COS_ID,RP_ID) Value(get_COS_ID,last_Cultural_ranking);

     set get_Last_ID = (SELECT Crp_ID FROM Cultural_generated_Ranking_points ORDER BY Crp_ID DESC LIMIT 1);

     INSERT INTO Results(Crp_ID,Sgrp_ID) Values(get_Last_ID,null);


     set sumdata = sumdata-1;

    end while;



END$$

