CREATE DEFINER=`root`@`localhost` PROCEDURE `sqlPr_Update_Cutural_Event`(IN CID Integer,
                                                           IN AID Integer,
                                                           IN CName Varchar(50),
                                                           IN CPercentage Integer,
                                                           IN CStatus Varchar(25),
                                                           IN CDate VarChar(25),
                                                           IN CType VarChar(25),
                                                           IN CSched VarChar(50),
                                                           IN CJudgeType VarChar(25))
BEGIN

      Declare lastrecord Integer;
      set lastrecord = (SELECT OP_ID FROM Overall_Points where OP_Type = 'Cultural Event' and OP_Status = 'Active' ORDER BY OP_ID DESC LIMIT 1);


      Update Cultural_Events set Cul_ID =CID,Acc_ID = AID,OP_ID = lastrecord ,Cul_Name =CName,Cul_Percentage =CPercentage,Cul_Status =CStatus,
                Cul_Type = CType,Cul_Date = CDate, Acc_Id = AID,Cul_Sched =CSched ,Cul_Type_Judging = CJudgeType Where Cul_ID = CID;
      Select('Successfully Save');

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sqlPr_Update_Overall_Points`(IN ID VarChar(25),
                                                            IN Percentage VarChar(25),
                                                            IN EventStatus VarChar(25),
                                                            IN OPType VarChar(25))
BEGIN
        Declare value1 Integer;
        Declare Value2 Integer;
        Declare dif Integer;
        Declare sport Integer;

        set sport = (Select OP_Percentage from Overall_Points Where OP_Type = 'Sports Event');
        set value1 = (Select SUM(OP_Percentage) from Overall_Points where OP_Status = 'Active');
        set dif = value1 -sport;
        set Value2 = dif+Percentage;

        if(Value2>100)then
            Select ('The Overall Points will contain total of More than 100% this is invalid');
        else

       UPDATE Overall_Points set OP_Percentage = Percentage,OP_Status = EventStatus ,OP_Type = OPType Where OP_ID = ID;
       Select('Successfully Updated');
       end if;

END$$

